import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { 
  MapPin, 
  Car, 
  Cloud, 
  Settings, 
  Play, 
  ArrowLeft,
  Zap,
  Leaf,
} from 'lucide-react';
import './SimulationSetup.css';

const SimulationSetup = () => {
  const navigate = useNavigate();
  const [selectedTrack, setSelectedTrack] = useState('');
  const [drivingMode, setDrivingMode] = useState('eco');
  const [weather, setWeather] = useState('clear');
  const [surface, setSurface] = useState('dry');
  const [modelVersion, setModelVersion] = useState('ppo');
  const [tracks, setTracks] = useState([]);

  useEffect(() => {
    loadTracks();
  }, []);

  const loadTracks = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/tracks');
      const data = await response.json();
      setTracks(data);
    } catch (error) {
      console.error('Failed to load tracks:', error);
      // Fallback tracks
      setTracks(['Catalunya', 'IMS', 'Silverstone', 'Monza', 'Spa']);
    }
  };

  const handleStartSimulation = () => {
    if (!selectedTrack) {
      alert('Please select a track');
      return;
    }

    const config = {
      track: selectedTrack,
      driving_mode: drivingMode,
      weather: weather,
      surface: surface,
      model_version: modelVersion
    };

    localStorage.setItem('simulationConfig', JSON.stringify(config));
    navigate('/dashboard');
  };

  return (
    <div className="simulation-setup">
      <div className="setup-container">
        <div className="setup-header">
          <Link to="/" className="back-button">
            <ArrowLeft size={20} />
            Back to Home
          </Link>
          <h1>Simulation Setup</h1>
          <p>Configure your eco-driving simulation parameters</p>
        </div>

        <div className="setup-content">
          <div className="setup-section">
            <h2>Track Selection</h2>
            <div className="track-grid">
              {tracks.map(track => (
                <button
                  key={track}
                  className={`track-card ${selectedTrack === track ? 'selected' : ''}`}
                  onClick={() => setSelectedTrack(track)}
                >
                  <MapPin size={20} />
                  <span>{track}</span>
                </button>
              ))}
            </div>
          </div>

          <div className="setup-section">
            <h2>Driving Mode</h2>
            <div className="mode-grid">
              <button
                className={`mode-card ${drivingMode === 'eco' ? 'selected' : ''}`}
                onClick={() => setDrivingMode('eco')}
              >
                <Leaf size={20} />
                <span>Eco Mode</span>
                <p>Maximum efficiency</p>
              </button>
              <button
                className={`mode-card ${drivingMode === 'balanced' ? 'selected' : ''}`}
                onClick={() => setDrivingMode('balanced')}
              >
                <Zap size={20} />
                <span>Balanced</span>
                <p>Efficiency + Performance</p>
              </button>
              <button
                className={`mode-card ${drivingMode === 'performance' ? 'selected' : ''}`}
                onClick={() => setDrivingMode('performance')}
              >
                <Car size={20} />
                <span>Performance</span>
                <p>Maximum speed</p>
              </button>
            </div>
          </div>

          <div className="setup-section">
            <h2>Environment</h2>
            <div className="environment-grid">
              <div className="env-group">
                <label>Weather</label>
                <select value={weather} onChange={(e) => setWeather(e.target.value)}>
                  <option value="clear">Clear</option>
                  <option value="rainy">Rainy</option>
                  <option value="cloudy">Cloudy</option>
                </select>
              </div>
              <div className="env-group">
                <label>Surface</label>
                <select value={surface} onChange={(e) => setSurface(e.target.value)}>
                  <option value="dry">Dry</option>
                  <option value="wet">Wet</option>
                  <option value="mixed">Mixed</option>
                </select>
              </div>
            </div>
          </div>

          <div className="setup-section">
            <h2>AI Model</h2>
            <div className="model-grid">
              <button
                className={`model-card ${modelVersion === 'ppo' ? 'selected' : ''}`}
                onClick={() => setModelVersion('ppo')}
              >
                <span>PPO</span>
                <p>Proximal Policy Optimization</p>
              </button>
              <button
                className={`model-card ${modelVersion === 'sac' ? 'selected' : ''}`}
                onClick={() => setModelVersion('sac')}
              >
                <span>SAC</span>
                <p>Soft Actor-Critic</p>
              </button>
            </div>
          </div>

          <div className="setup-actions">
            <button 
              className="start-button"
              onClick={handleStartSimulation}
              disabled={!selectedTrack}
            >
              <Play size={20} />
              Start Simulation
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SimulationSetup;
